import React, { Component } from 'react';
import Navbar from 'react-bootstrap/Navbar'

class Footer extends Component {
    constructor() {
        super()
    };

    render() {
        return (
            <>
                <Navbar bg="dark" sticky="bottom"> 
                </Navbar>
            </>
        )
    }
}
export default Footer;
